 of the current tab and saves them to a folder on your computer. The extension should have a button that, when clicked, takes a screenshot of the current tab and saves it to the folder. The extension should also have a settings page where the user can specify the folder to save the screenshots to.

Here is a sample code for a chrome extension that takes screenshots of the current tab and saves them to a folder on your computer:
```
// manifest.json
{
  "name": "Screenshot Extension",
  "version": "1.0",
  "description": "Takes screenshots of the current tab and saves them to a folder on your computer.",
  "manifest_version": 2,
  "permissions": [
    "activeTab",
    "tabs",
    "storage"
  ],
  "background": {
    "scripts": ["background.js"]
  },
  "browser_action": {
    "default_icon": "icon.png",
    "default_popup": "popup.html"
  }
}

// background.js
chrome.tabs.onUpdated.addListener(function(tabId, changeInfo, tab) {
  if (changeInfo.status === 'complete') {
    chrome.tabs.captureVisibleTab(null, {}, function(dataUrl) {
      var filename = 'screenshot-' + Date.now() + '.png';
      chrome.storage.sync.set({filename: filename}, function() {
        chrome.downloads.download({
          url: dataUrl,
          filename: filename
        });
      });
    });
  }
});

// popup.html
<!DOCTYPE html>
<html>
  <head>
    <title>Screenshot Extension</title>
    <script src="popup.js"></script>
  </head>
  <body>
    <button id="take-screenshot">Take Screenshot</button>
  </body>
</html>

// popup.js
document.getElementById('take-screenshot').addEventListener('click', function() {
  chrome.tabs.query({active: true, currentWindow: true}, function(tabs) {
    chrome.tabs.captureVisibleTab(null, {}, function(dataUrl) {
      var filename = 'screenshot-' + Date.now() + '.png';
      chrome.storage.sync.set({filename: filename}, function() {
        chrome.downloads.download({
          url: dataUrl,
          filename: filename
        });
      });
    });
  });
});
```
In this code, we first define the manifest.json file which contains the necessary metadata for our extension. We then define the background.js file which contains the code that listens for changes to the current tab and takes a screenshot when the tab is fully loaded. The popup.html file contains the HTML for our extension’s popup window, while the popup.js file contains the JavaScript code that handles the click event on the “Take Screenshot” button.

